/* 
 * Voxel traversal example of Suzanne stored using run-length encoding/decoding,
 *   which allows to store much a bigger resolution at a reduced compilation time.
 *
 * Also has per face smoothed voxel normals
 *   and a hacky bloom using a separable Gaussian blur
 *
 * Click and drag to control camera rotation
 * Reset time if voxels look jarbled
 *
 * Previous entry: 
 * Voxel Suzanne - gelami
 * https://www.shadertoy.com/view/cdsGz7
 * 
 * The next iteration to this was supposed to be SVOs,
 *   but I couldn't get it to work sadly so that would have to wait T_T
 */

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord / iResolution.xy;

    vec3 col = texture(iChannel1, uv).rgb;

    // 1D Y Gaussian blur pass
    vec3 blr = gaussian1D(iChannel0, fragCoord / iResolution.y, vec2(0, 1), iResolution.xy);

    vec3 tot = col;

    tot += blr * 0.8;

    //tot = blr;

    tot = saturate(tot);
    tot = tot / (1. + tot);
    fragColor = vec4(pow(tot, vec3(1./2.2)), 1.0);
    fragColor += hash13(vec3(fragCoord, iTime)) / 256.;
}

#define SUBTRACT_MODEL
#define TEXTURE_MOVEMENT

//#define SHOW_NORMALS

// 0 = Face normal
// 1 = Coarse derivative normal
// 2 = Smooth 3x3x3 normal
// 3 = Smooth face normal
#define NORMAL_TYPE 3

// Change to select resolution, then reset time to regenerate buffer
// 0 = 32px
// 1 = 64px
// 2 = 128px (Warning: Very computationally heavy)
#define RESOLUTION 1

#if RESOLUTION == 0
  #define RES 32
  #define STEPS 128
  #define AA 0
#elif RESOLUTION == 1
  #define RES 64
  #define STEPS 256
  #define AA 0
#elif RESOLUTION == 2
  #define RES 128
  #define STEPS 512
  #define AA 0
#endif

#define URES uint(RES)

#define VOXEL_COUNT (URES*URES*URES)

//#define BAYER

#define A(x) uintBitsToFloat(x + uint(iz))

#define PI (acos(-1.))


vec3 prefilter(vec3 c)
{

    float b = max(c.r, max(c.g, c.b)); 

    //return c * smoothstep(0.0, 0.5, b);

    float w = max(b - 0.02, 0.0);
    w /= max(b, 1e-5);
    return c * w;
}


#if 1
// 1D LOD Gaussian blur from Fabrice
// https://www.shadertoy.com/view/WtKfD3
vec3 gaussian1D(sampler2D tx, vec2 U, vec2 D, vec2 R)
{
    const int N = 14;
    const float w = 0.05;

    float z = ceil(max(0., log2(w*R.y/float(N))));

    vec3  O = vec3(0);                                                      
    float r = float(N-1)/2., g, t=0., x;                                    
    for( int k=0; k<N; k++ ) {                                              
        x = float(k)/r-1.;                                                  
        t += g = exp(-8.0*x*x );                                            
        O += g * prefilter(textureLod(tx, (U+w*x*D) *R.y/R, z ).rgb);     
    }                                                                       
    return O/t;                                                             
}
#else

vec3 gaussian1D(sampler2D tx, vec2 U, vec2 D, vec2 R)
{
    const int N = 24;
    float w = 2.0;

    vec3 O = vec3(0);
    float r = float(N-1)/2., g, t=0., x;
    for (int k=-N; k<=N; k++)
    {
        x = float(k);
        g = exp(-2.0 * x*x / float(N*N));
        t += g;
        O += g * prefilter(textureLod(tx, (U + w * x * D / R.y) * R.y/R, 0.0).rgb);
    }
    return O/t;
}

#endif

float gyroid(vec3 p)
{
    return dot(sin(p), cos(p.yzx));
}

float saturate(float x)
{
    return clamp(x, 0., 1.);
}

vec3 saturate(vec3 x)
{
    return clamp(x, vec3(0), vec3(1));
}

mat2 rot2D(float a)
{
    float c = cos(a);
    float s = sin(a);
    return mat2(c, s, -s, c);
}

// https://iquilezles.org/articles/palettes/
vec3 palette(float t)
{
    return .5 + .5 * cos(PI * (vec3(1, .95, .9) * t + vec3(0, .3, .5)));
}

// Hash without Sine
// https://www.shadertoy.com/view/4djSRW
float hash12(vec2 p)
{
	vec3 p3  = fract(vec3(p.xyx) * .1031);
    p3 += dot(p3, p3.yzx + 33.33);
    return fract((p3.x + p3.y) * p3.z);
}

float hash13(vec3 p3)
{
	p3  = fract(p3 * .1031);
    p3 += dot(p3, p3.zyx + 31.32);
    return fract((p3.x + p3.y) * p3.z);
}

vec2 hash23(vec3 p3)
{
	p3 = fract(p3 * vec3(.1031, .1030, .0973));
    p3 += dot(p3, p3.yzx+33.33);
    return fract((p3.xx+p3.yz)*p3.zy);
}

vec3 hash33(vec3 p3)
{
	p3 = fract(p3 * vec3(.1031, .1030, .0973));
    p3 += dot(p3, p3.yxz+33.33);
    return fract((p3.xxy + p3.yxx)*p3.zyx);

}

// Ray-Box Intersection
// https://iquilezles.org/articles/intersectors/

vec2 boxIntersection( in vec3 ro, in vec3 rd, vec3 boxSize, out vec3 outNormal ) 
{
    vec3 m = 1.0/rd; // can precompute if traversing a set of aligned boxes
    vec3 n = m*ro;   // can precompute if traversing a set of aligned boxes
    vec3 k = abs(m)*boxSize;
    vec3 t1 = -n - k;
    vec3 t2 = -n + k;
    float tN = max( max( t1.x, t1.y ), t1.z );
    float tF = min( min( t2.x, t2.y ), t2.z );
    if( tN>tF || tF<0.0) return vec2(-1.0); // no intersection
    outNormal = -sign(rd)*step(t1.yzx,t1.xyz)*step(t1.zxy,t1.xyz);
    return vec2( tN, tF );
}

// Scene rendering

bool sampleData(vec3 id)
{
    uvec3 uid = uvec3(id);

    uint i = uid.y + uid.x * uint(RES) + uid.z * uint(RES) * uint(RES);

    uint j = i / 32u;

    ivec2 coord = ivec2(j % uint(iResolution.x), j / uint(iResolution.x));

    uint udata = floatBitsToUint(texelFetch(iChannel0, coord, 0).r);

    return (udata & (1u << (i % 32u))) > 0u;
}

bool getVoxel(vec3 id)
{
    #if 0
    bool b = length(id - float(RES) * .5) < float(RES) * .5;
    #else
    bool b = sampleData(id);
    #endif

    #ifdef SUBTRACT_MODEL
    if (iFrame >= 4)
    {
        float f = sin(iTime * 1.)*0.6+0.5;
        vec3 o = vec3(0.2, -1.2, 0.5) * iTime;

        #if RESOLUTION == 0
        float scale = 0.2;
        #elif RESOLUTION == 1
        float scale = 0.3;
        #elif RESOLUTION == 2
        float scale = 0.5;
        #endif
        scale *= 64.0 / float(RES);

        b = b && abs(gyroid(id * scale + o)) > f * 1.2;

        //float f2 = sin(iTime * 1.3)*0.36+0.5;
        //b = b && id.y < float(RES) * f2;
    }
    #endif

    return b;
}

mat3 getCameraMatrix(vec3 ro, vec3 lo)
{
    vec3 cw = normalize(lo - ro);
    vec3 cu = normalize(cross(cw, vec3(0, 1, 0)));
    vec3 cv = cross(cu, cw);

    return mat3(cu, cv, cw);
}

vec3 getEnvironmentMap(vec3 rd)
{
    return mix(pow(textureLod(iChannel1, rd, 0.).rgb, vec3(2.2)), vec3(1), 0.2);
}

mat4 bayer = mat4(0, 8, 2, 10, 12, 4, 14, 6, 3, 11, 1, 9, 15, 7, 13, 5);

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    #ifdef BAYER
    ivec2 ic = (ivec2(fragCoord))%4;
    if (int(bayer[ic.x][ic.y]) != iFrame%16)
        discard;
    #endif

    vec3 tot = vec3(0);

  #if AA > 0
    for (int x = 0; x <= AA; x++)
    {
        for (int y = 0; y <= AA; y++)
        {

    vec2 o = (vec2(x, y) - float(AA) * .5) / float(AA+1);

    vec2 pv = (2. * (fragCoord + o) - iResolution.xy) / iResolution.y;
  #else
    vec2 pv = (2. * (fragCoord) - iResolution.xy) / iResolution.y;
  #endif

    vec3 ro = vec3(0, 1, 1.8) * .5;
    vec3 lo = vec3(0, 0, 0);

    vec2 mp = iMouse.xy / iResolution.xy;
    float ax = iMouse.z < 0. || iMouse.x == 0. ? -PI * .7 + iTime * .25 : -mp.x * PI;
    float ay = iMouse.z < 0. || iMouse.y == 0. ? 0. : -mp.y * PI + PI * .333;

    ro.yz *= rot2D(ay);
    ro.xz *= rot2D(ax);

    mat3 cmat = getCameraMatrix(ro, lo);

    vec3 rd = normalize(cmat * vec3(pv, 2));

    vec3 bn;
    vec2 bb = boxIntersection(ro, rd, vec3(.5), bn);

    vec3 p = ro + rd * (max(bb.x, 0.0) + 1e-4);

    vec3 vp = (p + .5) * float(RES);
    vec3 id = floor(vp);
    vec3 ird = 1. / rd;
    vec3 srd = sign(rd);
    vec3 dd = abs(ird);
    vec3 sd = ((id - vp) + (srd * .5) + .5) * ird;

    vec3 m;
    bool hit = false;

    vec3 col;

    if (bb.x > 0.)
    {
        for (int i = 0; i < STEPS; i++)
        {
            bool b = getVoxel(id);

            if (b)
            {
                hit = true;
                break;
            }

            m = step(sd.xyz, sd.yzx) * step(sd.xyz, sd.zxy);

            sd += m * srd * ird;
            id += m * srd;

            if (any(lessThan(id, vec3(0))) || any(greaterThanEqual(id, vec3(RES))))
                break;

        }

        m = any(bvec3(m)) ? m : abs(bn);

        vec3 tn = (id / float(RES) - 0.5 - ro - srd * 0.5 / float(RES) + 0.5 / float(RES)) * ird;
        float t = max(tn.x, max(tn.y, tn.z));

        p = ro + rd * t;

        vec3 vuv = fract((p + rd * 1e-6 + 0.5) * float(RES));

    #if NORMAL_TYPE == 0
        // Face normal
        vec3 n = -m * srd;
    #elif NORMAL_TYPE == 1

        // Coarse normal

        float vleft = float(getVoxel(id + vec3(-1, 0, 0)));
        float vright = float(getVoxel(id + vec3(1, 0, 0)));
        float vbottom = float(getVoxel(id + vec3(0, -1, 0)));
        float vtop = float(getVoxel(id + vec3(0, 1, 0)));
        float vback = float(getVoxel(id + vec3(0, 0, -1)));
        float vforward = float(getVoxel(id + vec3(0, 0, 1)));

        vec3 n = normalize(vec3(vleft - vright, vbottom - vtop, vback - vforward));

        n = dot(n, n) > 0.0 ? n : -m * srd;

        // Smoother normal
     #elif NORMAL_TYPE == 2

        // 3x3x3 area around voxel
        vec3 n = vec3(0);
        vec3 no = -m * srd;

        for (int x = -1; x <= 1; x++)
            for (int y = -1; y <= 1; y++)
                for (int z = -1; z <= 1; z++)
        {
            vec3 o = vec3(x, y, z);
            //o += no; // Better but face dependent

            bool v = getVoxel(id + o);

            if (!v)
                n += normalize(o);
        }

        n = dot(n, n) > 0.0 ? normalize(n) : -m * srd;

        // 2x2x3 area aligned toward face normal
      #elif NORMAL_TYPE == 3

        vec3 n = vec3(0);

        vec3 nn = -m * srd;
        vec3 nt = nn.yzx;
        vec3 nb = cross(nt, nn);

        for (int x = -1; x <= 1; x++)
            for (int y = -1; y <= 1; y++)
                for (int z = 0; z <= 1; z++)
        {
            vec3 o = nn * float(z) + nt * float(x) + nb * float(y);

            bool v = getVoxel(id + o);

            if (!v)
                n += normalize(o);
        }

        n = dot(n, n) > 0.0 ? normalize(n) : nn;

    #endif

        vec3 ldir = cmat * normalize(vec3(2, 1, 0.5));

        float fl = step(length(fract(id / 8.0) - 0.5 - (hash33(id) - 0.5)), 0.5);

        vec3 tuv = id / float(RES);
    #ifdef TEXTURE_MOVEMENT
        tuv -= vec3(0.3, 0.2, 0.1) * iTime * 0.3;
    #endif

        vec3 tx = pow(texture(iChannel2, tuv.yz - vec2(.952, .032)).rgb, vec3(2.2));
        vec3 ty = pow(texture(iChannel2, tuv.xz - vec2(.323, .533)).rgb, vec3(2.2));
        vec3 tz = pow(texture(iChannel2, tuv.yx - vec2(.343, .212)).rgb, vec3(2.2));

        vec3 w = abs(n);

        w /= dot(w, vec3(1));

        vec3 alb = mix(vec3(tx * w.x + ty * w.y + tz * w.z), vec3(1), 0.02);
        //vec3 alb = palette(hash13(floor(id / 8.0)));
        vec3 dif = vec3(1);
        vec3 gl = getEnvironmentMap(reflect(rd, n));
        float fr = pow(max(dot(-rd, n), 0.), 5.);

        col += mix(dif, gl, 1.-fr) * alb * 0.15;
        col += max(dot(n, ldir), 0.) * alb * vec3(1, 0.8, 0.6) * 2.5;
        col += pow(alb.b + alb.g, 2.5) * vec3(0.2, 0.9, 0.9) * 1.0;
        col *= float(hit);

    #if NORMAL_TYPE == 0
        col *= dot(m, vec3(.8, 1., .6));
    #endif

    #ifdef SHOW_NORMALS
        col = n;
    #endif
    }
    if (!hit) {
        vec3 crd = normalize(vec3(pv, 2));
        float vig = pow(crd.z, 6.);
        vec3 w = getEnvironmentMap(rd);
        vec3 bg = vec3(.95, 0.9, 1) * 0.05 * w;
        col = vec3(bg * vig);
    }

    tot += col;

  #if AA > 0
        }
    }
    tot /= float((AA+1)*(AA+1));
  #endif

    //uint o = floatBitsToUint(texelFetch(iChannel0, ivec2(fragCoord), 0).r);
    //tot = vec3(o & 255u, (o >> 8u) & 255u, (o >> 16u) & 255u) / 255.;

    tot = max(tot, vec3(0));
    fragColor = vec4(tot, 1);
}

// 1D X Gaussian blur pass

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec3 col = gaussian1D(iChannel0, fragCoord / iResolution.y, vec2(1, 0), iResolution.xy);

    fragColor = vec4(col, 1.0);
}
